import jwt from "jsonwebtoken";
import dotenv from "dotenv";

dotenv.config();

export const getToken = (params) => {
  const token = jwt.sign(params, process.env.SECRET_KEY || "loginTokenKey", {
    expiresIn: process.env.EXPIRE_IN || "370d",
  });

  return token;
};

export const decoding = (token) => {
  const payload = jwt.verify(token, process.env.SECRET_KEY || "loginTokenKey");
  return payload;
};

import joi from "joi";

export const userValidation = async (req, res, next) => {
  const userSchema = joi
    .object({
      username: joi.string().required().messages({
        "any.required": "Username is required",
      }),
      email: joi.string().required().messages({
        "any.required": "Email is required",
      }),
      password: joi.string().min(8).required().messages({
        "any.required": "Password required",
        "string.min": "Password require 8 characters",
      }),
      confirm_password: joi.string().min(8).required().messages({
        "any.required": "Confrim Password required",
        "string.min": "Confirm Password require 8 characters",
      }),
    })
    .options({ allowUnknown: true });
  const value = await userSchema.validate(req.body);
  if (value.error) {
    res.status(400).json({
      message: value.error.details[0].message.replace(/["'`]+/g, ""),
    });
  } else {
    next();
  }
};

